import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './AppointmentForm.css';

const AppointmentForm = () => {
    const [doctors, setDoctors] = useState([]);
    const [doctorId, setDoctorId] = useState('');
    const [phone, setPhone] = useState('');
    const [email, setEmail] = useState('');
    const [reason, setReason] = useState('');
    const [appointmentDate, setAppointmentDate] = useState('');
    const [error, setError] = useState('');
    const [success, setSuccess] = useState('');
    const navigate = useNavigate();

    // ✅ Fetch doctors on component load
    useEffect(() => {
        axios.get('http://localhost:8080/api/doctors')
            .then(response => {
                setDoctors(response.data);
            })
            .catch(error => {
                console.error('Error fetching doctors:', error);
            });
    }, []);

    // ✅ Handle form submission
    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');
        setSuccess('');

        if (!doctorId || !phone || !email || !reason || !appointmentDate) {
            setError('All fields are required.');
            return;
        }

        const formattedDate = new Date(appointmentDate).toISOString();

        const appointmentData = {
            doctor: { id: parseInt(doctorId) },
            phone,
            email,
            reason,
            appointmentDate: formattedDate
        };

        console.log('Submitting Appointment Data:', appointmentData);

        try {
            const response = await axios.post('http://localhost:8080/api/appointments', appointmentData);
            console.log('Success:', response.data);

            setSuccess('Appointment booked successfully!');
            setTimeout(() => navigate('/appointments'), 1500);  // Redirect after success
        } catch (error) {
            console.error('Failed to book appointment:', error);
            setError(error.response?.data || 'Failed to book appointment. Please try again.');
        }
    };

    return (
        <div className="appointment-form-container">
            <h2>Book Appointment</h2>

            {error && <div className="error-message">{error}</div>}
            {success && <div className="success-message">{success}</div>}

            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label>Doctor:</label>
                    <select value={doctorId} onChange={(e) => setDoctorId(e.target.value)} required>
                        <option value="">Select Doctor</option>
                        {doctors.map(doctor => (
                            <option key={doctor.id} value={doctor.id}>
                                {doctor.name} - {doctor.specialization}
                            </option>
                        ))}
                    </select>
                </div>

                <div className="form-group">
                    <label>Phone:</label>
                    <input
                        type="text"
                        value={phone}
                        onChange={(e) => setPhone(e.target.value)}
                        placeholder="Enter 10-digit phone number"
                        pattern="^[0-9]{10}$"
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Email:</label>
                    <input
                        type="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        placeholder="Enter valid email"
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Reason:</label>
                    <textarea
                        value={reason}
                        onChange={(e) => setReason(e.target.value)}
                        placeholder="Enter reason"
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Date:</label>
                    <input
                        type="datetime-local"
                        value={appointmentDate}
                        onChange={(e) => setAppointmentDate(e.target.value)}
                        required
                    />
                </div>

                <button type="submit">Book Appointment</button>
            </form>
        </div>
    );
};

export default AppointmentForm;
